    /**
     * Query that I'm using that the stub will return null with.  This is technically a 
     * valid query but I need something to get the stub to return null.
     */
    private final String case3URLQuery = "http://maps.googleapis.com/maps/api/directions/json?"
            + "origin=3801+Brooklyn+Ave+NE%2CSeattle%2CWA&destination=1320+S+Maple+Grove+Road"
            + "%2C+Boise%2C+ID&sensor=true&mode=bicycling&alternatives=true";
    
    /**
     * The JSON response that the case3URLQuery maps to.  We are simulating a null response
     * from the GoogleAPIs with this one.  By checking for null in our doQuery method
     * we know to throw an IOException(), meaning we could not connect to Google.
     */
    private final String case3JSONResponseConnectionFailedThrowIOException = null; 
    
    /**
     * A query that the origin and destination fields are made up.  This will cause the Google
     * APIs to return a route with zero results.
     */
    private final String case4URLQuery = "http://maps.googleapis.com/maps/api/directions/"
    		+ "json?origin=pig&destination=bacon&sensor=true&mode=bicycling&alternatives=true";
    
    /**
     * The JSON response that the case4URLQuery maps to.
     */
    private final String case4JSONResponseGoogleReturnsNoResults = "{\"routes\":[],\"status\":\"ZERO_RESULTS\"}";
    
    
    /**
     * Query that I'm using that the stub will return "Request Denied" status.  This is technically a 
     * valid query (even though it would technically return ZERO_RESULTS) 
     * but I need something to get the stub to return "Request Denied" with. If I chose an  
     * invalid query the validate parameters method would prevent it from 
     * getting any farther in the code.
     */
    private final String case5URLQuery = "http://maps.googleapis.com/maps/api/directions/"
            + "json?origin=cow&destination=steak&sensor=true&mode=bicycling&alternatives=true";
    
    /**
     * The JSON response that the case5URLQuery maps to.
     */
    private final String case5JSONResponseGoogleDeniesRequest = "{\"routes\":[],\"status\" : \"REQUEST_DENIED\"}";
    
    /**
     * Constructor that loads all of the query-response mappings into the hashMap.
     */
    public StubGoogleAPIWrapper() {
        queryMap.put(case1URLQuery, case1JSONResponseStandardResponse);
        queryMap.put(case2URLQuery, case2JSONResponseStressTest);
        queryMap.put(case3URLQuery, case3JSONResponseConnectionFailedThrowIOException);
        queryMap.put(case4URLQuery, case4JSONResponseGoogleReturnsNoResults);
        queryMap.put(case5URLQuery, case5JSONResponseGoogleDeniesRequest);
    }
    
    /* (non-Javadoc)
     * @see com.HuskySoft.metrobike.backend.APIQuery#doQuery(java.lang.String)
     */
    @Override
    public String doQuery(String theURL) throws IOException {
        System.out.println(TAG + "doQuery()->theURL: " + theURL);
        if(theURL == null) {
            throw new IllegalArgumentException("theURL parameter was null.");
        } else if(!queryMap.containsKey(theURL)) {
            throw new IllegalArgumentException("theURL: " + theURL + " Did not exist in the queryMap.");
        } else {
            String jsonResponse = queryMap.get(theURL);
            if(jsonResponse == null) {
                throw new IOException("Simulating the failure to connect to the Google Map APIs");
            } else {
                return jsonResponse;
            }
        }
    }    
